'''
1047. Remove All Adjacent Duplicates In String
https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string/
'''
from typing import List

from test_tool import assert_value


class Solution:
    def removeDuplicates(self, s: str) -> str:
        s = list(s)
        while True:
            cnt = 0
            i = 0
            while i < len(s) - 1:
                if s[i] == s[i + 1]:
                    del s[i: i + 2]
                    i -= 1
                    i = max(0, i)
                    cnt += 1
                else:
                    i += 1
            if cnt == 0:
                return ''.join(s)
        return ''


assert_value("ca", Solution().removeDuplicates, s="abbaca")
assert_value("ay", Solution().removeDuplicates, s="azxxzy")
assert_value("", Solution().removeDuplicates, s="")
